pragma solidity ^0.5.8;

// Se usa bytes32 en vez de string ya que solidity no permite
// actualmente pasar por argumento un array de strings, el funcionamiento
// debería de considerarse el mismo
contract Voting {
	// Usaremos este mapping para asociar los votos a los nombres
	// de los participantes
	mapping (bytes32 => uint8) public votesReceived;
	bytes32[] public candidateList;

	// Creamos el contrato con la lista de candidatos especificada
	constructor(bytes32[] memory candidateNames) public {
		candidateList = candidateNames;
	}

	// Función para obtener los votos de un candidato
	function totalVotesFor(bytes32 candidate) public view returns (uint8) {
		require(validCandidate(candidate), "Candidate is not valid");
		return votesReceived[candidate];
	}

	// Función usada para votar a un candidato
	function voteForCandidate(bytes32 candidate) public {
		require(validCandidate(candidate), "Candidate is not valid");
		votesReceived[candidate] += 1;
	}

	// Función para comprobar si un candidato existe
	function validCandidate(bytes32 candidate) public view returns (bool) {
		for(uint i = 0; i < candidateList.length; i++) {
			if (candidateList[i] == candidate) {
				return true;
			}
		}
		return false;
	}
}
